"   </div>",
"   <div class=\"lgnd\">",
"    Retinal examination in a patient with papilledema due to malignant hypertension. There is blurring of the margins of the optic disc, distension of the retinal veins, two cotton wool spots inferior to the disc, and a flame-shaped hemorrhage at a venous bifurcation (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
