"   <div class=\"cntnt\" style=\"width: 397px; height: 334px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Retinal examination in a patient with malignant hypertension and grade IV hypertensive retinopathy. The optic disc is swollen with indistinct borders. There is venous tortuosity with multiple cotton wool spots and numerous flame-shaped (large arrows) and punctate hemorrhages (small arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced by permission from: Gallasch G, Ritz E, Nephrol Dial Trans 1997; 12:1518.",
