var title_f30_56_31623="Adynamic bone disease";
var content_f30_56_31623=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F75592&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F75592&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Micrograph showing adynamic or aplastic bone disease in end-stage renal disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 258px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Bone biopsy showing adynamic or aplastic bone disease in end-stage renal failure. This disorder is characterized by reductions in bone formation and bone resorption that are manifested histologically by thin osteoid seams (red lines at the bone surface; arrows) and little or no evidence of cellular activity.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of L Darryl Quarles, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Micrograph showing normal bone histology",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 382px; height: 269px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Histologic appearance of normal bone.",
"    <br>",
"     (Left panel) Goldner Masson trichrome stain shows mineralized lamellar bone in blue and adjacent nonmineralized osteoid in red-brown. Osteoid usually comprises less than 25 percent of bone surfaces. The cellular area between the osseous structures is the marrow space.",
"     <br>",
"      (Right panel) Villanueva-stained section viewed under polarized light following time-spaced tetracycline labeling. Osteoid appears orange, mineralized bone is green, and tetracycline markers appear as luminescent yellow-green bands within bone and beneath osteoid (arrow). The distinct dual bands represent active mineralized bone formation.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Courtesy of L Darryl Quarles, MD.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
