" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Unipolar depression in adults and selective serotonin reuptake inhibitors (SSRIs): Pharmacology, administration, and side effects",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?30/56/31626/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
