"     Michael Hirsch, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?30/56/31626/contributors\">",
"     Robert J Birnbaum, MD, PhD",
"    </a>",
"    <br/>",
"   </div>",
