var title_f30_56_31629="ETT HR recovery prognosis";
var content_f30_56_31629=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57524&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57524&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Heart rate recovery after exercise predicts mortality",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 430px; height: 292px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In a study of 2428 patients without known heart disease, an abnormal value for the recovery of heart rate, defined as a reduction of &le;12 beats per minute (bpm) from the heart rate at peak exercise, was associated with an increased risk of death. Circles represent the relative risk of death for each of the quintiles as compared with the fifth quintile which had the lowest risk of death; red lines represent the 95 percent confidence interval.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Cole CR, Blackstone EH, Pashkow FJ, et al. N Engl J Med 1999; 341:1351",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
